To use this function, paste the below code snippet in a new file and import from your function package.

def below_threshold(arr, y):
    for i in range(0, arr.get_size(), y):
        if arr[i] >= y:
            return False
        if i == arr.get_size() - 1:
            return True
    return True                                            
